import React from "react";
import styled from "styled-components";
import ModalEffect from "./ModalEffect";

/**
 * Modal View
 */
// SignIn
export const SignInModal = () => {
  return (
    <ModalEffect>
      <h2>로그인</h2>
      <InputSection>
        <SignInForm>
          <small>ID</small>
          <input placeholder="아이디를 입력해주세요."></input>
        </SignInForm>
      </InputSection>

      <BtnSection></BtnSection>
    </ModalEffect>
  );
};
// SignUp
export const SignUpModal = () => {
  return (
    <ModalEffect>
      <h2>회원가입</h2>
    </ModalEffect>
  );
};

/**
 * Modal Style
 */
// Input
const SignInForm = styled.form`
width: 80%;
text-align: center;
`;
const InputSection = styled.div`
  width: 80%;
  height: 300px;
  background-color: blue;
  position: absolute;
  top: 0;
  display: flex;
`;
// Button
const BtnSection = styled.div`
  width: 80%;
`;
